In C, there are several ways to terminate a program. Here are a few common methods:

1. Using `exit()` function: The `exit()` function is the most common way to terminate a C program. It returns control to the operating system, which then terminates the program. The `exit()` function takes an integer argument, which can be used to specify the exit code. For example:
```c
#include <stdio.h>

int main() {
    // ...
    exit(0); // exit with a success code
    return 0;
}
```
2. Using `return 0`: If you want to return an exit code to the operating system, you can use the `return 0` statement instead of `exit()`. This is a more concise way to terminate a program. For example:
```c
#include <stdio.h>

int main() {
    // ...
    return 0; // exit with a success code
}
```
3. Using `system()` function: The `system()` function can be used to execute a command that terminates the program. For example:
```c
#include <stdio.h>

int main() {
    // ...
    system("exit"); // terminate the program
    return 0;
}
```
4. Using `abort()` function: The `abort()` function is similar to `exit()`, but it does not return an exit code to the operating system. It is usually used when an error occurs and you want to terminate the program immediately. For example:
```c
#include <stdio.h>

int main() {
    // ...
    abort(); // terminate the program immediately
    return 0;
}
```
5. Using `signal()` function: The `signal()` function can be used to handle signals, which can be used to terminate a program. For example:
```c
#include <stdio.h>

int main() {
    // ...
    signal(SIGINT, handle_signal); // handle SIGINT signal
    return 0;
}

void handle_signal(int signum) {
    // handle the SIGINT signal
    exit(0);
}
```
Note that the `signal()` function is not a standard C function, but it is available in many C libraries, including the `signal` library.

It's worth noting that the `exit()` function and the `return 0` statement are the most common ways to terminate a C program, and they are both recommended for most cases. The `system()` function and the `abort()` function are usually used in specific situations, such as when you want to execute a command or when an error occurs. The `signal()` function is useful when you want to handle signals in a program.</s>
